<!DOCTYPE html>
<html lang="en">

<head>
    <title>Dextricity - Securly Bypass</title>
    <link rel="icon" href="https://raw.githubusercontent.com/iAmDextricity/iamdextricity.github.io/main/icon.webp" type="image/webp">
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: 'Work Sans', sans-serif;
            height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            background: url("https://i.ibb.co/JtST5SG/pretty.jpg") no-repeat center center fixed; 
            background-size: cover;
        }

        #container {
            box-sizing: border-box;
            padding: 40px;
            width: 70%;
            max-width: 500px;
            background-color: rgba(255, 255, 255, 0.9);
            border-radius: 10px;
            text-align: center;
            color: #333;
        }

        h1 {
            margin: 0;
            font-weight: bold;
            font-size: 2em;
            letter-spacing: -0.04em;
            margin-bottom: 10px;
            color: #333;
        }

        #error {
            display: none;
            color: red;
            margin-bottom: 20px;
        }

        #draggable {
            display: none;
            background-color: black;
            color: white;
            padding: 10px;
            font-weight: bold;
            cursor: pointer;
        }

        .shown {
            display: inline-block !important;
        }

        .download-container {
            display: flex;
            justify-content: center;
            margin-top: 20px;
        }

        .download {
            width: 100%;
            text-decoration: none;
            background-color: DodgerBlue;
            border: none;
            border-radius: 10px;
            box-shadow: 0 4px #666;
            padding: 15px;
            font-size: 18px;
            text-align: center;
            cursor: pointer;
            outline: none;
            color: white;
            transition: background 0.3s, box-shadow 0.3s;
        }

        .download:hover {
            background-color: RoyalBlue;
            box-shadow: 0 8px #999;
        }

        .download:active {
            background-color: RoyalBlue;
            box-shadow: 0 4px #666;
            transform: translateY(2px);
        }
    </style>
